import React from "react";
import "./tint-card.styles.css";

export const TintCard = ({ options }) => {
  const { tintType, description, brands, shades, features } = options;

  return (
    <div className="card-container">
      <div className="tint-card-left">
        <h2 className="card-header">{tintType}</h2>
        <span className="card-description">{description}</span>
        <header className="tint-shades"> SHADES AVAILABLE</header>
        <span>{shades.map((shade) => shade)}</span>
      </div>

      <div className="tint-card-right"></div>
    </div>
  );
};
